(53565, 0, 0, 'Such skill for a new trainee.', 12, 0, 100, 511, 0, 0, 56431, 'Aspiring Trainee to Training Target'),
(53565, 0, 1, 'That target didn''t stand a chance.', 12, 0, 100, 511, 0, 0, 56433, 'Aspiring Trainee to Training Target'),
(53565, 0, 2, 'One day you will have to teach me your secrets.', 12, 0, 100, 509, 0, 0, 56432, 'Aspiring Trainee to Training Target'),
(53565, 0, 3, 'You are bound for a great things, trainee.', 12, 0, 100, 508, 0, 0, 56435, 'Aspiring Trainee to Training Target'),
(53565, 0, 4, 'I must train harder so I can be like you.', 12, 0, 100, 1, 0, 0, 56437, 'Aspiring Trainee to Training Target'),
(53565, 0, 5, 'I hope the instructors saw that!', 12, 0, 100, 1, 0, 0, 56434, 'Aspiring Trainee to Training Target'),
(53565, 0, 6, 'I must work as hard as you.', 12, 0, 100, 1, 0, 0, 56436, 'Aspiring Trainee to Training Target'),
(53565, 1, 0, 'My money''s on Lam. Did you see him take down Chu during training last week?', 12, 0, 100, 1, 0, 0, 56420, 'Aspiring Trainee'),
(53565, 2, 0, 'His stamina is nothing against Lam''s strength.', 12, 0, 100, 0, 0, 0, 56423, 'Aspiring Trainee'),
(53565, 3, 0, 'He has the legs of an ox! Have you ever been kicked by him in training?', 12, 0, 100, 1, 0, 0, 56424, 'Aspiring Trainee'),
(53565, 4, 0, 'Raise you a keg of Stormshout Gold. It''ll be your loss.', 12, 0, 100, 1, 0, 0, 0, 'Aspiring Trainee'),
(53565, 5, 0, 'That''s where you''re mistaken, friend. Zhou is as sturdy as an oak.', 12, 0, 100, 1, 0, 0, 56421, 'Aspiring Trainee'),
(53565, 6, 0, 'Zhou has the stamina of three men, so he can out-stay most opponents.', 12, 0, 100, 0, 0, 0, 56422, 'Aspiring Trainee'),
(53565, 7, 0, 'Four coppers on Zhou.', 12, 0, 100, 0, 0, 0, 56427, 'Aspiring Trainee'),
(54586, 0, 0, 'That was a good match. Thank you.', 12, 0, 100, 1, 0, 0, 56444, 'Huojin Trainee'),
(54586, 0, 1, 'My skills are no match for yours. I admit defeat.', 12, 0, 100, 1, 0, 0, 56441, 'Huojin Trainee'),
(54586, 0, 2, 'Your skills are too great. I yield.', 12, 0, 100, 1, 0, 0, 56442, 'Huojin Trainee'),
(54586, 0, 3, 'You fought well. I must learn more from you in the future.', 12, 0, 100, 1, 0, 0, 56443, 'Huojin Trainee'),
(54586, 0, 4, 'Thank you for reminding me that I must train more diligently.', 12, 0, 100, 1, 0, 0, 56439, 'Huojin Trainee'),
(54586, 0, 5, 'You fight honorably, friend.', 12, 0, 100, 1, 0, 0, 56440, 'Huojin Trainee'),
(54586, 0, 6, 'You are an honorable opponent.', 12, 0, 100, 1, 0, 0, 56438, 'Huojin Trainee'),
