(60176, 0, 0, 'The fire spirit is upset. It''s dangerous to enter the shrine now...', 12, 0, 100, 396, 0, 0, 59680, 'Huojin Monk to Player'),
(54135, 0, 0, 'You have earned the right to proceed.  Huo lies beyond.', 12, 0, 100, 1, 0, 0, 55251, 'Master Li Fei to Player'),
(60248, 0, 0, 'Is that... is that Huo?', 12, 0, 100, 25, 0, 0, 59751, 'Chia-hui Autumnleaf to Player'),
(60729, 0, 0, 'Ji may kill Shen-zin Su if we let him go through with this! Come with me, $p, quickly!', 12, 0, 100, 5, 0, 0, 55140, 'Aysa Cloudsinger to Player'),
(60250, 0, 0, 'Hey there! Are you the one that brought back the fire spirit?', 12, 0, 100, 3, 0, 0, 59875, 'Cai to Deng'),
(56663, 0, 0, 'Or if you want to wander the woods a while, Aysa and I can hang out here.  You know... just the two of us.', 12, 0, 100, 1, 0, 0, 55552, 'Ji Firepaw to Player'),
(60852, 0, 0, 'We stand by your side, friend.  This battle is not yours alone.', 12, 0, 100, 6, 0, 0, 59719, 'Korga Strongmane to Player'),
(57721, 0, 0, 'Master Shang Xi, I would like to accompany the Alliance back to their home.', 12, 0, 100, 1, 0, 0, 60628, 'Aysa Cloudsinger to Player'),
(54611, 0, 0, 'A challenger approaches.', 12, 0, 100, 113, 0, 0, 59692, 'Jaomin Ro to Player'),
(54611, 1, 0, 'You''ve been trained well.', 12, 0, 100, 2, 0, 0, 55205, 'Jaomin Ro to Player'),
(54611, 1, 1, 'Well fought. Master Shang will be pleased.', 12, 0, 100, 2, 0, 0, 55206, 'Jaomin Ro to Player'),
(54611, 1, 2, 'Amazing! You''re much stronger than you look.', 12, 0, 100, 2, 0, 0, 55207, 'Jaomin Ro to Player'),
(54611, 1, 3, 'It seems I have more training to do. Thank you for the lesson.', 12, 0, 100, 2, 0, 0, 55208, 'Jaomin Ro to Player'),
(54611, 1, 4, 'I bow to your skill. You bested me fairly.', 12, 0, 100, 2, 0, 0, 55209, 'Jaomin Ro to Player'),
(54611, 1, 5, 'It was an honor to be defeated by you.', 12, 0, 100, 2, 0, 0, 55210, 'Jaomin Ro to Player'),
(60900, 0, 0, 'Let''s go find this engineer.  Maybe getting this thorn removed won''t be as hard as we thought.', 12, 0, 100, 396, 0, 0, 60379, 'Ji Firepaw to Player'),
(57638, 0, 0, 'The reeds of the Singing Pools are the hardest in all of the land, but they are as air before my mighty brow.', 12, 0, 100, 1, 0, 0, 56333, 'Jojo Ironbrow to Player'),
(55477, 0, 0, 'Why...', 12, 0, 100, 507, 0, 0, 60452, 'Ji Firepaw'),
(54975, 0, 0, 'I have to admit, that looked pretty fun!', 12, 0, 100, 1, 0, 0, 66056, 'Aysa Cloudsinger to Player'),
(59642, 0, 0, 'Keep those creatures at bay while I meditate. We''ll soon have the answers we seek.', 12, 0, 100, 1, 0, 27398, 59161, 'Aysa Cloudsinger to Player'),
(55943, 0, 0, 'Never met them before in my life. Pandaren don''t really come in any bad flavors though.', 12, 0, 100, 1, 0, 0, 59554, 'Wei Palerage to Player'),
(60253, 0, 0, 'It is! Well done, $p!', 12, 0, 100, 71, 0, 0, 59752, 'Brewer Lin to Player'),
(54786, 0, 0, 'Welcome, Huo. The people have missed your warmth.', 12, 0, 100, 2, 0, 0, 60608, 'Master Shang Xi to Player'),
(55672, 0, 0, 'And here we are. Help me with a couple small tasks while I prepare, if you would.', 12, 0, 100, 1, 0, 0, 56485, 'Master Shang Xi to Player'),
(61127, 0, 0, 'On it!', 12, 0, 100, 0, 0, 0, 60606, 'Ji Firepaw to Fire Central Temple Turn-in Controller'),
(56013, 0, 0, 'You''ve all accomplished a great thing in saving Shen-zin Su. You do us all proud.', 12, 0, 100, 1, 0, 0, 60632, 'Spirit of Master Shang Xi to Player'),
(60042, 0, 0, 'Wei, are these friends of yours?', 12, 0, 100, 6, 0, 0, 54956, 'Korga Strongmane to Player'),
(60741, 0, 0, 'Aysa, this is our only option. We blow the ship free, then we heal his wound. We have no other solution.', 12, 0, 100, 1, 0, 0, 60189, 'Ji Firepaw to Aysa Cloudsinger'),
(60878, 0, 0, 'If all pandaren are like you, I think you may have made some new allies!', 12, 0, 100, 396, 0, 0, 60345, 'Alliance Priest to 60848'),
(64881, 0, 0, 'We live on the back of a big turtle?!', 12, 0, 100, 5, 0, 0, 65637, 'Hao to Lorewalker Amai'),
(55539, 0, 0, '%s snorts loudly, and continues sleeping.', 16, 0, 100, 0, 0, 0, 54991, 'Wugou to Player'),
(55744, 0, 0, 'Wait!', 12, 0, 100, 5, 0, 0, 54355, 'Aysa Cloudsinger to Player'),
(57712, 0, 0, 'Hello friend!  You''re welcome to use my cart if you like.  It will take you to the Dai-Lo Farmstead.', 12, 0, 100, 3, 0, 0, 56406, 'Delivery Cart Tender to Player'),
(59986, 0, 0, '$n''s here. Let''s go.', 12, 0, 100, 432, 0, 0, 59481, 'Aysa Cloudsinger to Player'),
(57692, 0, 0, 'This is magnificent!  I''ve never seen craftsmanship so fine.', 12, 0, 100, 1, 0, 0, 56363, 'Jojo Ironbrow to Player'),
(56662, 0, 0, 'We''re ready to go whenever you are, $n.', 12, 0, 100, 1, 0, 0, 55549, 'Aysa Cloudsinger to Player'),
(56418, 0, 0, 'If we lose the healers, Shen-zin Su dies, and all of us with him!  Keep them safe.', 14, 0, 100, 0, 0, 0, 66063, 'Ji Firepaw'),
(59652, 0, 0, 'Meet me up in the cave if you would, friend.', 12, 0, 100, 396, 0, 27397, 59147, 'Aysa Cloudsinger to Player'),
(55694, 0, 0, 'Hey $p! This way to Morning Breeze Village.', 12, 0, 100, 0, 0, 0, 54196, 'Ji Firepaw to Player'),
(57720, 0, 0, 'Yes... perhaps that is for the best. I like what I''ve seen of them, and it sounds as though their world could use my help.', 12, 0, 100, 273, 0, 0, 60630, 'Ji Firepaw to Player'),
(60770, 0, 0, 'Keep these creatures off of us while we perform our healing.', 12, 0, 100, 396, 0, 0, 60347, 'Horde Druid to Player'),
(60183, 0, 0, 'I hope you''re ready, $p. Jaomin Ro awaits you just over the bridge.', 12, 0, 100, 113, 0, 0, 59710, 'Trainee Nim to Player'),
(54943, 0, 0, 'Shhhh! Come quietly. She''s practicing.', 12, 0, 100, 396, 0, 0, 59712, 'Merchant Lorvo to Player'),
(55483, 0, 0, 'AIIIIEEEEEEE!', 12, 0, 100, 0, 0, 0, 54874, 'Plump Virmen to Player'),
(60249, 0, 0, 'Was he hot?  I bet he was hot!', 12, 0, 100, 6, 0, 0, 59876, 'Deng to Cai'),
(55595, 0, 0, 'Dafeng! What''s wrong? Why are you hiding back here?', 12, 0, 100, 1, 0, 0, 54362, 'Aysa Cloudsinger to Player'),
(64885, 0, 0, 'Hello $n! The Lorewalker is beginning her lesson just down these stairs if you want to listen in.', 12, 0, 100, 3, 0, 0, 65573, 'Lorewalker Zan to Player'),
(59988, 0, 0, 'Let me try.', 12, 0, 100, 5, 0, 0, 59513, 'Ji Firepaw to Player'),
(60244, 0, 0, 'You''re departing so soon?  I am envious of your prowess, $c. Good luck to you.', 12, 0, 100, 2, 0, 0, 59711, 'Trainee Guang to Player'),
(65558, 0, 0, 'Let''s tackle this one together!', 12, 0, 100, 5, 0, 0, 60609, 'Ji Firepaw to Player'),
(60888, 0, 0, 'I bear your presence only as a kindness to our new allies. Don''t push me, human.', 12, 0, 100, 0, 0, 0, 60359, 'Korga Strongmane to Player'),
(60889, 0, 0, 'Stand down, tauren, before I put you back in chains.', 12, 0, 100, 396, 0, 0, 60623, 'Delora Lionheart to Player'),
(57669, 0, 0, 'Our crafters build the finest wooden planks.  They would weather the most brutal of storms.  But they are as water before the storm of my crushing skull.', 12, 0, 100, 1, 0, 0, 56343, 'Jojo Ironbrow to Player'),
(56236, 0, 0, 'I owe you my life.', 12, 0, 100, 2, 0, 0, 64348, 'Injured Sailor to Player'),
(60851, 0, 0, 'We''ll cover this front. You keep my priests safe.', 12, 0, 100, 396, 0, 0, 59720, 'Delora Lionheart to Player'),
(56660, 0, 0, '$p, where''s Master Shang?', 12, 0, 100, 6, 0, 33099, 55554, 'Ji Firepaw to Aysa Cloudsinger'),
(56686, 0, 0, 'For 3,000 years, we have passed the knowledge of our people down. Elder to youth. Master to student.', 12, 0, 100, 1, 0, 33097, 55528, 'Master Shang Xi to Player'),
(56159, 0, 0, 'Come child. We have one final journey to take together before your training is complete.', 12, 0, 100, 1, 0, 0, 55520, 'Master Shang Xi to Player'),
(56416, 0, 0, 'Thank Shen-zin Su that you''re here.  I could use your help!', 12, 0, 100, 1, 0, 0, 64848, 'Aysa Cloudsinger to Vordraka, the Deep Sea Nightmare'),
(60834, 0, 0, 'I''m heading to the wound. Try to keep these beasts off of me.', 12, 0, 100, 396, 0, 0, 60342, 'Horde Druid to 60848'),
(56676, 0, 0, 'I am in pain, but it warms my heart that Liu Lang''s grandchildren have not forgotten me.', 12, 0, 100, 0, 0, 0, 55550, 'Shen-zin Su to Player'),
(60877, 0, 0, 'I''m heading to the wound. Try to keep these beasts off of me.', 12, 0, 100, 396, 0, 0, 60342, 'Alliance Priest to Player'),
(64880, 0, 0, 'Sheesh, Hao. Haven''t you ever paid attention?', 12, 0, 100, 1, 0, 0, 65638, 'Nan to Lorewalker Amai'),
(56661, 0, 0, '...Ji, they were in the Wood of Staves.  You know where Master Shang is now.', 12, 0, 100, 1, 0, 0, 55555, 'Aysa Cloudsinger to Shang Xi''s Hot Air Balloon'),
(61126, 0, 0, 'Yes master.', 12, 0, 100, 2, 0, 0, 60607, 'Aysa Cloudsinger to Fire Central Temple Turn-in Controller'),
(64875, 0, 0, 'He grew and grew and grew, SO big, that now some people call him "The Wandering Isle."', 12, 0, 100, 1, 0, 0, 65589, 'Lorewalker Amai to Lorewalker Ruolin'),
(64506, 0, 0, 'That''s the way to do it!', 12, 0, 100, 1, 0, 0, 64766, 'Aysa Cloudsinger to Zhao-Ren'),
(54856, 0, 0, 'Master Li Fei''s voice echoes, "The way of the Tushui... enlightenment through patience and meditation... the principled life."', 16, 0, 100, 6, 0, 0, 53129, 'Master Li Fei to Player'),
(54856, 1, 0, 'Master Li Fei''s voice echoes, "It is good to see you again, Aysa. You''ve come with respect, and so I shall give you the answers you seek."', 16, 0, 100, 1, 0, 0, 53845, 'Master Li Fei to Player'),
(54856, 2, 0, 'Master Li Fei''s voice echoes, "Huo, the spirit of fire, is known for his hunger. He wants for tinder to eat. He needs the caress of the wind to rouse him."', 16, 0, 100, 1, 0, 0, 53841, 'Master Li Fei to Player'),
(54856, 3, 0, 'Master Li Fei''s voice echoes, "If you find these things and bring them to his cave, on the far side of Wu-Song Village, you will face a challenge within."', 16, 0, 100, 1, 0, 0, 53842, 'Master Li Fei to Player'),
(54856, 4, 0, 'Master Li Fei''s voice echoes, "Overcome that challenge, and you shall be graced by Huo''s presence. Rekindle his flame, and if your spirit is pure, he shall follow you."', 16, 0, 100, 1, 0, 0, 53843, 'Master Li Fei to Player'),
(54856, 5, 0, 'Master Li Fei''s voice echoes, "Go, children. We shall meet again very soon."', 16, 0, 100, 2, 0, 0, 53844, 'Master Li Fei to Player'),
(54856, 6, 0, 'Master Li Fei fades away.', 16, 0, 100, 0, 0, 0, 53130, 'Master Li Fei to Player'),
(54567, 0, 0, 'A challenge in compassion and humility. By helping Merchant Lorvo, it would seem you''ve passed, $c. Master Shang would be pleased.', 12, 0, 100, 2, 0, 27404, 60599, 'Aysa Cloudsinger to Player'),
(54567, 1, 0, 'And so our path lays before us. Speak to Master Shang Xi, he will tell you what comes next.', 12, 0, 100, 0, 0, 27399, 60046, 'Aysa Cloudsinger to Player'),
(64879, 0, 0, '...Whenever he got hungry?', 12, 0, 100, 1, 0, 0, 65645, 'Yin to Lorewalker Amai'),
(54568, 0, 0, 'Take that monkeybutt!', 12, 0, 100, 5, 0, 0, 59757, 'Ji Firepaw to Player'),
(56503, 0, 0, 'Master Shang has trained you well. Thank you, friend!', 12, 0, 100, 2, 0, 0, 53265, 'Min Dimwind to Player'),
(56503, 1, 0, 'I couldn''t have fought them off alone. Now, if you''ll excuse me, I should go find my cart.', 12, 0, 100, 1, 0, 0, 56452, 'Min Dimwind to Player'),
(56503, 2, 0, 'Cart!', 14, 0, 100, 22, 0, 0, 56453, 'Min Dimwind to Player'),
(56503, 3, 0, 'Hello, cart. Still upside-downed, I see.', 12, 0, 100, 2, 0, 0, 56454, 'Min Dimwind to Player'),
(57670, 0, 0, 'These are the densest stones across all of Shen-zin Su, yet they are as nothing before my mighty head.', 12, 0, 100, 1, 0, 0, 56355, 'Jojo Ironbrow to Player'),
(55504, 0, 0, 'Gimme all your vegetables!', 12, 0, 100, 0, 0, 0, 54873, 'Plump Carrotcruncher to Player'),
(54130, 0, 0, 'Look out! Its friendses are coming!', 14, 0, 100, 2, 0, 0, 56473, 'Amberleaf Scamp to Player'),
(54130, 1, 0, 'Run away!', 14, 0, 100, 2, 0, 0, 56474, 'Amberleaf Scamp to Player');
